// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

contract InsuranceContract {
    
    struct Policy {
        uint premium; 
        uint coverageAmount; 
        uint expirationTimestamp;
        bool active; 
    }

    
    struct Claim {
        address policyHolder; 
        uint claimAmount; 
        bool approved; 
        bool exists; 
    }

    
    mapping(address => Policy) public policies;

    
    mapping(bytes32 => Claim) public claims;

    
    event PolicyCreated(address indexed policyHolder, uint premium, uint coverageAmount, uint expirationTimestamp);

  
    event ClaimSubmitted(bytes32 indexed claimId, address indexed policyHolder, uint claimAmount);

    
    function purchasePolicy(uint _coverageAmount, uint _expirationTimestamp) external payable {
        require(msg.value > 0, "Premium amount must be greater than 0");
        require(!policies[msg.sender].active, "Policy already active");

        policies[msg.sender] = Policy({
            premium: msg.value,
            coverageAmount: _coverageAmount,
            expirationTimestamp: _expirationTimestamp,
            active: true
        });

        emit PolicyCreated(msg.sender, msg.value, _coverageAmount, _expirationTimestamp);
    }

    
    function submitClaim() external {
        require(policies[msg.sender].active, "No active policy found");
        require(block.timestamp < policies[msg.sender].expirationTimestamp, "Policy expired");

        bytes32 claimId = keccak256(abi.encodePacked(msg.sender, block.timestamp));
        claims[claimId] = Claim({
            policyHolder: msg.sender,
            claimAmount: policies[msg.sender].coverageAmount,
            approved: false,
            exists: true
        });

        emit ClaimSubmitted(claimId, msg.sender, policies[msg.sender].coverageAmount);
    }

     address public insurerAddress;

// Constructor to set the insurer address
constructor() {
    insurerAddress = msg.sender; // This will set the address of the contract deployer as the insurer address
}



    //Function to approve a claim (only accessible to the insurer)
    function approveClaim(bytes32 _claimId) external {
        require(msg.sender == insurerAddress, "Only insurer can approve claims");
        require(claims[_claimId].exists, "Claim does not exist");

        claims[_claimId].approved = true;

        // Payout to policy holder
        payable(claims[_claimId].policyHolder).transfer(claims[_claimId].claimAmount);
    }
}

